import { render } from 'react-dom';

export const Form = () => {
    const formStyle = {
        position: "fixed",
        width:"400px",
        padding:"40px",
        

    };
        
        return(
            
            <div className="form" style={formStyle}>
            <form>
                <label>
                Email :
                <input type="text"
                placeholder="Enter Your Email"
                 />
                </label>
                <div className="Captcha"></div>
                <input type="submit" value="Submit" />
            </form>
            </div>
        )
        
    
}
